




function dateStringPlus(datestr)
	{
	M = ""; D = ""; Y = "";
	Mn = Dn = Yn = 0;
	
	datevec = trim(datestr).split("/");
	MM = datevec[0];
	M = "(";
	for(var i=0;i<MM.length;i++)
		{
		myChar = MM.charAt(i);
		myNumber = returnNumber(myChar);
		M += "" + myNumber + "  +  ";	
		Mn += myNumber;	
		}
	M  = M .substr(0,M .length-5);
	M += ")";
	
	DD = datevec[1];
	D = "(" + DD + ")";
	Dn = parseInt(DD,10);
	
	YY = datevec[2];
	Y = "(";
	for(var i=0;i<YY.length;i++)
		{
		myChar = YY.charAt(i);
		myNumber = returnNumber(myChar);
		Y += "" + myNumber + "  +  ";	
		Yn += myNumber;	
		}
	Y  = Y .substr(0,Y .length-5);
	Y += ")";
	
	myS1 = "" + M + "  +  " + D + "  +  " + Y;
	myS2 = "" + "(" + Mn + ")" + "  +  " + D + "  +  (" + Yn + ")";
	
	Tn = Mn + Dn + Yn;
	// myS3 = "" + "(" + Tn + ")" + "  =  " + reduceMe(Tn);
	myS3 = "" + "(" + Tn + ")";
	
	myS = "" + myS1 + "  ... <br/>" + myS2 + "  ...  " + myS3;
	
	return myS;
	}

